script: |
  super -f text -I q1816.spq | sort > q1816.out

inputs:
  - name: q1816.spq
    data: |
      SELECT + + col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 54 IN ( - + col1, 69 + col1 * - col2, - - col1 );
  - name: tab1

outputs:
  - name: q1816.out
    data: |
      14
      47
      5
